/**
 * @module jquery__config
 */

modules.define(
    'jquery__config',
    ['ua', 'objects'],
    function(provide, ua, objects, base) {

provide(
    ua.msie && parseInt(ua.version, 10) < 9?
        objects.extend(
            base,
            {
                url : '//yandex.st/jquery/1.10.2/jquery.min.js'
            }) :
        base);

});